import React, {useState} from 'react';

function App() {

  let [title, setTitle] = useState('남자 코드 추천');
  let [title2, setTitle2] = useState('여자 코드 추천');
  let [title3, setTitle3] = useState('여름옷 추천');
  return (
    <div className="App">
      <div className="black-nav">
        <div>개발 Blog</div>
      </div>

      <div className="list">
        <h3> {title} </h3>
        <p>4월 30일 발행</p>
        <hr/>
      </div>

      <div className="list">
        <h3> {title2} </h3>
        <p>5월 5일 발행</p>
        <hr/>
      </div>

      <div className="list">
        <h3> {title3} </h3>
        <p>6월 11일 발행</p>
        <hr/>
      </div>
    </div>
  );
}

export default App;
